import React from 'react';
import logo from './logo.svg';
import './App.css';


const TableHeader = ()=>{
  return (
  <tr>
    <td> ID</td>
    <td> Name</td>
  </tr>)
}

const TableValues = ()=>{
  return (
  <tr>
    <td> ID</td>
    <td> Name</td>
  </tr>)
}
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <table  border="1">
          <TableHeader/>
          <TableValues/>
        </table>
      </header>
    </div>
  );
}

export default App;
